DROP TABLE IF EXISTS `invitations`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `invitations` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `male_name` varchar(255) DEFAULT NULL,
  `female_name` varchar(255) DEFAULT NULL,
  `male_text` longtext DEFAULT NULL,
  `female_text` longtext DEFAULT NULL,
  `main_text` longtext DEFAULT NULL,
  `template` varchar(255) NOT NULL,
  `invitation_link` varchar(255) NOT NULL,
  `male_photo` varchar(255) DEFAULT NULL,
  `female_photo` varchar(255) DEFAULT NULL,
  `group_photo` varchar(255) NOT NULL,
  `date` varchar(255) NOT NULL,
  `restaurant_id` bigint(20) unsigned DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `user_id` bigint(20) unsigned DEFAULT NULL,
  `male_quote` longtext DEFAULT NULL,
  `female_quote` longtext DEFAULT NULL,
  `email` varchar(255) NOT NULL,
  `lat` double(20,10) DEFAULT NULL,
  `lng` double(20,10) DEFAULT NULL,
  `hash` varchar(255) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `years` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `invitations_invitation_link_unique` (`invitation_link`),
  KEY `invitations_restaurant_id_foreign` (`restaurant_id`),
  KEY `invitations_user_id_foreign` (`user_id`),
  CONSTRAINT `invitations_restaurant_id_foreign` FOREIGN KEY (`restaurant_id`) REFERENCES `restaurants` (`id`),
  CONSTRAINT `invitations_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=154 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

