INSERT INTO `invitations` VALUES (34,'Стеванче','Елена','<p>На секој човек му е потребен животен сопатник, многу љубов и разбирање.</p>\n<p>Ако сонцето ја има месечината, денот ја има ноќта, планината го има морето, животот ја има смртта, длабочината ја има висината, галамата ја има тишината, среќата ја има тагата, доброто го има злото - јас ја имам Елена . Таа е сè што недостасуваше во мојот живот, а заедно сме енергијата, земјата, водата, воздухот и огнот. Ви благодарам што сте дел од нашиот живот.</p>\n<p>Дојдете да си поминеме убаво!</p>','<p>Како секоја принцеза, така и јас сонував за принцот на бел коњ. Но, за кратко време сфатив дека реалноста е многу поубава од секоја бајка, од секој коњ, од секој сон... Наместо да се плашам од иднината, решив после една година да влезам во една друга реалност која ме научи на мир, среќа и на решителност. Заедно со Стеванче постигнавме многу за кратко време и едвај чекам да видам што можеме да направиме понатаму. Но, без Вашата поддршка, љубов и грижа, никогаш немаше да бидеме тука.</p>','Со огромна чест и задоволство Ве покануваме заедно да ја прославиме една од нашите најважни вечери во животот. Од Вас очекуваме да донесете само позитивна енергија и удобни чевли за играње. Се гледаме!','template_a','elena-stevanche','1705616503.IMG_0487.jpeg','1705616478.IMG_0471.jpeg','1705616567.IMG_0919.jpeg','2024-11-16',NULL,'2024-01-18 22:22:57','2024-01-18 22:22:57',NULL,'<p>Доста време ерген одев, доста лични моми водев, дојде време да се женам, овој живот да го сменам.</p>','<p>\"We mature in knowledge and wisdom but never leave the playground of our hearts.\"</p>','stevce@gmail.com',NULL,NULL,'7d7acaccfa05691a081ce26729e19792',NULL,NULL),(51,'ССССDDDС','асДАСДДДДДДД','<p>На секој човек му е потребен животен сопатник, многу љубов и разбирање.</p><p>Ако сонцето ја има месечината, денот ја има ноќта, планината го има морето, животот ја има смртта, длабочината ја има висината, галамата ја има тишината, среќата ја има тагата, доброто 