INSERT INTO `musicians` VALUES (1,'Virtuoz Band','virtuoz-band','93767-IMG_8923.JPG','84311-virtuozband-logo.jpeg','076 561 006','<p>Добредојдовте на нашиот музички свет, каде што љубовта, веселбата и вистинската забава стануваат едно! Ние сме Virtuouz Band, твојот совршен избор за музичко доживување на свадбени прослави и настаните кои ги прават специјални.</p>\r\n\r\n<p>Сме бенд составен од искусни и талентирани музичари, предани на идејата да ја трансформираме вашата свадба или било кој друг настан во незаборавно искуство. Нашата мисија е да создадеме атмосфера полна со радост, емоции и бескрајни моменти на забава.</p>\r\n\r\n<p>Со вистински македонски инструменти, ние го донесуваме автентичниот и изразителен звук на народната и забавната македонска музика. Од традиционалните тамбурашки мелодии до сочни ритмови на нашите инструменти, ние го носиме духот на македонската музичка наследба.</p>\r\n\r\n<p>Нашата филозофија е да го прилагодиме нашиот репертоар според вашите желби и потреби. Нудиме разнообразен избор на музика, вклучувајќи ги народните хитови, современите хитови и класичните балкански ритмови.</p>\r\n\r\n<p>Со Virtuouz Band, не само што гарантираме музичка перформанса, туку и ја создаваме вистинската конекција со нашата публика. Секој настан за нас е уникатен и го третираме со посебна внимателност и професионализам.</p>\r\n\r\n<p>Доверете ни ги вашите најважни моменти и дозволете ни да ги претвориме во магични искуства. Контактирајте не денес и резервирајте го вашиот термин, бидејќи Virtuouz Band е тука за да го направи вашиот настан незаборавен и уникатен!</p>',24,'Musician  / Band','https://www.facebook.com/profile.php?id=61556183235280','https://www.instagram.com/grupavirtuoz/','n/a','https://www.youtube.com/@grupavirtuoz','https://dragigosti.com/musicians/virtuous-band','2024-02-26 22:11:37','2024-02-28 11:56:12',41.9991689272,21.3878093726),(2,'Група Маестро','grupa-maestro','5654-maestro-band.jpeg','35489-maestro-logo.jpeg','078 939 534','<p>Група МАЕСТРО е музички состав од Скопје основан 2012 година, кој настапува на сите видови свечености и прослави: свадби, крштевки, веридби, матурски и апсолвентски вечери, деловни прослави и сл. Група МАЕСТРО интерпретира македонски народни и новокомпонирани песни и ора, балканска народна и популарна музика, светски популарни хитови, како и класична и евергрин инструментална музика и е една од ретките во Македонија кои можат да ги задоволат сите музички вкусови со богатиот и разновиден репертоар. Група МАЕСТРО е редовен учесник на фестивалите за новокомпонирана македонска фолк музика: &quot;Валандово&quot;, &quot;Цветници&quot;, &quot;Роса&quot;, &quot;Охрид фест&quot; и др. како и дел од концертите на најпознатите музички имиња.</p>\r\n\r\n<p></p>\r\n\r\n<p>Членови:</p>\r\n\r\n<p>Илија Филиповски - виолина</p>\r\n\r\n<p>Александар Тренкоски - кларинет и саксофон</p>\r\n\r\n<p>Војче Петрушев - хармоника</p>\r\n\r\n<p>Кирил Митоски - вокал</p>\r\n\r\n<p>Љупче Ѓоргиев - клавијатури, кавал и зурла</p>\r\n\r\n<p>Гаврило Дуковски - ударни инструменти и тапан</p>',25,'Musician / Band','https://www.facebook.com/GrupaMaestro','https://www.instagram.com/grupamaestro/','n/a','https://youtube.com/@GrupaMaestro','https://grupamaestro.mk/','2024-02-26 23:53:08','2024-04-02 19:27:15',41.9981294000,21.4254355000),(3,'DJ IRIE SCRTACH','dj-irie-scrtach','62845-IMG_9120.JPG','3791-SureShotz Ent_logo (1)_page-0001.jpg','+38978685834','<p></p>\r\n\r\n<p dir=\"ltr\">Irie Scratch е предводник на новата генерација на диџеи во Македонија и член на Sure Shotz Entertainment. После 15 години на сцената, има големо домашно и интернационално искуство, 7 години резиденција на party островот Иос во Грција како и многубројни клубски и фестивалски настапи во Македонија и регионот. Тој е препознатлив по постојана иновација, поставување нови трендови и туркање на хип-хоп сцената напред, инспириран од различни жанрови и култури - од хаус до реге и се измеѓу. Во пандемијата го започнува својот последен проект, Pandamonium Radio, со цел на промовирање на културата и поврзување на луѓето вклучени во неа - преку неделен поткаст, содржина на социјални мрежи, како и вмрежување преку нови платформи како Дискорд. Во последно време се враќа на своите корени на снимање и објавување на миксови, како и курирање на Spotify плејлисти.</p>\r\n\r\n<p></p>',38,'spinning records, blending styles, bending genres, drinking tons, setting trends, having fun.','https://www.facebook.com/sureshotzmk','https://www.instagram.com/iriescratch/','n/a','https://www.youtube.com/@IrieScratch','n/a','2024-03-20 22:00:26','2024-03-20 22:00:26',NULL,NULL),(4,'DJ Nasty','dj-nasty','34137-IMG_4328 (1).jpg','16962-SureShotz Ent_logo (1)_page-0001.jpg','+389 75 999 740','<p>Активен на сцената како DJ повеќе од 10 години и член на Sure Shotz. Најчесто врти нов клубски хип-хоп, аренби и throwbacks, а истовремено е голем љубител на afrobeat.<br />\r\nВо последно време има фокус на миксови, рутини и turntablism, и во 2020 го започна серијалот наречен rhythm&amp;tones на неговиот инстаграм профил.<br />\r\n&nbsp;</p>',40,'Emotions are contagious, Music moves you even when you refuse to dance.','n/a','https://www.instagram.com/djnaasty','n/a','n/a','n/a','2024-03-28 20:31:18','2024-03-28 20:31:18',NULL,NULL),(5,'OGIPSILON','ogipsilon','52811-20230401-Mask_n_Shake-235.jpg','13521-SureShotz Ent_logo (1).jpg','+389 72 233 924','<p></p>\r\n\r\n<p>Ogipsilon е диџеј и продуцент од Скопје, најмладиот член на екипата на Sure Shotz. Неговата диџејска кариера започнува во 2017 година, а досега има настапувано на повеќе настани и фестивали во Македонија, меѓу кои: D Festival, Trapslavia, April Fool&rsquo;s Shake во МКЦ, Skopje Shake, како и повеќе различни клубови низ целата држава. Стилот му се заснова на трап звук излезен после 2012 година, постојано е во тек со новите трендови и изданија, а неретко знае и да оддаде почит и во своите сетови да вметне постари хип-хоп класици. Како продуцент, досега има издадено еден beat-tape, A Turn For The Better, и е продуцент на синглови на различни артисти од сцената.</p>',41,'Dj/Producer','n/a','https://www.instagram.com/ogipsilon/','n/a','https://www.youtube.com/@ogipsilon7820','n/a','2024-03-28 21:58:48','2024-03-28 21:58:48',41.9981294000,21.4254355000),(7,'DJ Shorty P','dj-shorty-p','85086-shorty p 2.jpg','48606-SureShotz Ent_logo (1).jpg','070 269 993','<p>Shorty P познат како Панчо е вистински OG на македонската сцена, и основач на Sure Shotz Entertainment кој годинава слави 20 години постоење. Неговата посветеност кон хип-хоп културата во текот на кариерата му носи безброј клубски резиденции и фестивалски настапи, како низ Македонија така и во странство, како и радио емисија на #1 станицата во Македонија - Antenna5. Како промотер, тој е причината за настапите на многу хип-хоп легенди во Македонија, какo: XZIBIT, KRS One, Pete Rock &amp; CL Smooth, DJ Premier, Jazzy Jeff и многу други. Во последните години, тој и неговата екипа се познати по настаните SPICY, ШИЗИ, SHAYO и SHAKE.</p>',42,'Pancho | DNK','https://www.facebook.com/pancho.shortydnk','https://www.instagram.com/djshortypofficial/','n/a',NULL,'n/a','2024-04-01 19:05:35','2024-04-01 19:05:35',NULL,NULL),(8,'Артист Бенд','artist-bend','25104-bend.jpg','80545-logo-artist.png','078538133','<p>Артист Бенд е во состав од пет члена: пејач - Кристијан Тасевски, клавијатуристи - Даниел Маневски и Никола Николовски, дувачки инструменти - Теодор Љушкоски и тапанар - Душан Ангеловски.</p>\r\n\r\n<p></p>\r\n\r\n<p>Бендот веќе неколку години настапува низ целата држава нудејќи богата програма од забавни и народни, македонски, балкански и светски хитови.</p>\r\n\r\n<p></p>\r\n\r\n<p>Сето ова може да се забележи и на нивниот youtube канал каде што имаат направено кавер верзии на песни од најширок спектар.&nbsp;</p>\r\n\r\n<p></p>\r\n\r\n<p>Покрај препеаните кавери, имаат реализирано и две авторски песни</p>\r\n\r\n<p>&bdquo;Ѕвездо моја&ldquo; и &bdquo;После тебе.&ldquo;</p>',51,'We make music, we make art','https://www.facebook.com/artist.band.mk?mibextid=ZbWKwL','https://www.instagram.com/artistband_official?igsh=ZHpyZ3lwaHR3MDk=','n/a','https://youtube.com/@artistband5878?si=2mSfZtEoLicfDB_F','n/a','2024-04-18 17:45:38','2024-04-18 19:21:02',NULL,NULL),(9,'BokaConga','bokaconga','18800-1713470892373734.jpg','56113-Screenshot 2024-04-19 at 13.03.08.png','077729533','<h2 dir=\"auto\" style=\"text-align:center\">Latino performer accompanied by a Dj and a band</h2>\r\n\r\n<p dir=\"auto\" style=\"text-align: center;\"><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen=\"\" frameborder=\"0\" height=\"560\" scrolling=\"no\" src=\"https://www.youtube.com/embed/lHTrx7HqTj4\" title=\"YouTube video player\" width=\"800\"></iframe></p>\r\n\r\n<p style=\"text-align:center\"><iframe allow=\"autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share\" allowfullscreen=\"true\" frameborder=\"0\" height=\"626\" scrolling=\"no\" src=\"https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2Fbojanbokaconga%2Fposts%2Fpfbid0spA9rtLLTxRJwuRi2ZMKvup28XPVwBFBMKbiLwkBhRd93XW4xiUND37WLLAHwhJSl&amp;show_text=true&amp;width=500\" width=\"800\"></iframe></p>\r\n\r\n<p style=\"text-align:center\"><iframe allow=\"autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share\" allowfullscreen=\"true\" frameborder=\"0\" height=\"671\" scrolling=\"no\" src=\"https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2Fbojanbokaconga%2Fposts%2Fpfbid0a3m76iQjJF7JpXwzMUFBeLCJVBkPQrXBHd9aXdXafZZZ3ftcEuU9RWRKXKewgApil&amp;show_text=true&amp;width=500\" width=\"800\"></iframe></p>\r\n\r\n<p style=\"text-align:center\"><iframe align=\"middle\" allow=\"autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share\" allowfullscreen=\"true\" frameborder=\"1\" height=\"905\" scrolling=\"yes\" src=\"https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2Fbojanbokaconga%2Fposts%2Fpfbid02z81cnboB4xdHzeMGDXFwAVF4mPrNGc5enBVgm3QnTvNrxkE4f7UVpx7n9Wy3LhBql&amp;width=800&amp;show_text=true&amp;appId=765586645616557&amp;height=905\" width=\"800\"></iframe></p>\r\n\r\n<p></p>',52,'Artist','https://www.facebook.com/bojanbokaconga','https://www.instagram.com/bokaconga/','n/a','n/a','https://bokaconga.com/','2024-04-18 19:29:46','2024-04-19 10:11:44',41.9981294000,21.4254355000),(10,'ConTruDJ','contrudj','52760-band-cover.jpg','27067-LogotoNaPostuvanjeto.png','076 482 936','<p>ConTruDj се формирани&nbsp;во 2007 година во Битола, Македонија, каде што започнаа да работат како кавер бенд на живо, мешајќи конги и труби&nbsp;во хаус&nbsp;музиката.&nbsp; Нивните омилени стилови&nbsp;се афро хаус, фанк хаус, диско хаус, латино&nbsp;хаус.</p>\r\n\r\n<p>Изведуваат&nbsp;самостојно но и соработуваат со познати музичари во Балканот и надвор од него.</p>\r\n\r\n<p>ConTruDj настапуваат редовно на големи фестивали и концерти заедно со ѕвезди како Горан Бреговиќ, Сенида, S.A.R.S., Дубиоза Колектив и многу други&nbsp; музички ѕвезди во земјата и на Балканот.</p>',53,'Congas, Trumpet and DJ trio bringing the heat with Afro Funk House groove. 🪘🎺🎧','https://www.facebook.com/ConTruDj/','https://instagram.com/contrudj','n/a','https://youtube.com/@ConTruDjOfficial','n/a','2024-04-18 20:58:08','2024-04-19 09:45:22',NULL,NULL),(11,'Тони Зен','toni-zen','9596-toni-dj.jpeg','52695-Screenshot 2024-04-19 at 13.37.10.png','078350702','<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen=\"\" frameborder=\"0\" height=\"600\" referrerpolicy=\"strict-origin-when-cross-origin\" scrolling=\"no\" src=\"https://www.youtube.com/embed/eXJ37J5sqqg?si=WEHD__spJArDrRPr\" title=\"YouTube video player\" width=\"560\"></iframe></p>\r\n\r\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen=\"\" frameborder=\"0\" height=\"600\" referrerpolicy=\"strict-origin-when-cross-origin\" scrolling=\"no\" src=\"https://www.youtube.com/embed/K7w3NEvdSg8?si=OGlsQaHi0hnGtQPj\" title=\"YouTube video player\" width=\"560\"></iframe><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen=\"\" frameborder=\"0\" height=\"600\" referrerpolicy=\"strict-origin-when-cross-origin\" scrolling=\"no\" src=\"https://www.youtube.com/embed/4U5-AnHjeIE?si=EjNlLKnmNiPLVTID\" title=\"YouTube video player\" width=\"560\"></iframe><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen=\"\" frameborder=\"0\" height=\"600\" referrerpolicy=\"strict-origin-when-cross-origin\" scrolling=\"no\" src=\"https://www.youtube.com/embed/Zi44hRrDqVY?si=evSEpoBt3wsH9YHJ\" title=\"YouTube video player\" width=\"560\"></iframe></p>\r\n\r\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen=\"\" frameborder=\"0\" height=\"600\" referrerpolicy=\"strict-origin-when-cross-origin\" scrolling=\"no\" src=\"https://www.youtube.com/embed/EW3erEsTX_E?si=VMVRbkJ9XWeeiU02\" title=\"YouTube video player\" width=\"560\"></iframe><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen=\"\" frameborder=\"0\" height=\"600\" referrerpolicy=\"strict-origin-when-cross-origin\" scrolling=\"no\" src=\"https://www.youtube.com/embed/FsIMjQnZ5ns?si=oyXsVT_cdj0bBSoY\" title=\"YouTube video player\" width=\"560\"></iframe></p>',54,'Артист','https://www.facebook.com/Toniverse','https://www.instagram.com/tonizentoni/','n/a','https://www.youtube.com/@TheOfficialToniZen','n/a','2024-04-19 10:45:18','2024-04-19 11:07:06',41.6086350000,21.7452750000),(12,'Контраплан','kontraplan','82026-86633702_3722519587788823_228646166005284864_n.jpg','24769-85092654_3716089558431826_2674775975476068352_n.jpg','078 450 210','<p></p>\r\n\r\n<p>Контраплан е бенд кој веќе 14 години активно настапува на Македонската забавна музичка сцена. Во репертоарот има над 150 странски, Македонски и ex-Yu хитови, а со својата енергија на сцената ги оживува најдобрите моменти од музичката историја. Бендот е составен од 5 члена: 2 вокали (женски и машки), гитара, бас и бубањ, секогаш подготвени вашиот настан да го претворат во вистинско музичко искуство.</p>\r\n\r\n<p></p>',56,'Вашиот омилен кавер бенд','https://www.facebook.com/Kontraplaan/','n/a','n/a','https://www.youtube.com/@kontraplan8673','n/a','2024-04-22 14:54:24','2024-04-22 14:54:24',NULL,NULL),(13,'Идеал Бенд','ideal-bend','28673-Slika (2).jpg','32380-Logo ideal.PNG','075/873-831','<p>&nbsp;Идеал Бенд Скопје е повеќе од само музичка група составена од млади и талентирани музички артисти &ndash; тие се симбол на младинскиот дух и енергија, кои неуморно работат за да ја пренесат својата страст кон музиката на секој кој ќе ги слушне. Со својата разновидност и уникатен пристап, без разлика дали се работи за македонска традиционална музика или за светски познати хитови тие го обединуваат минатото и сегашноста, создавајќи незаборавни музички моменти за сите генерации.&nbsp;</p>\r\n\r\n<p></p>\r\n\r\n<p></p>',67,'Совршен избор кој Вашите свадби или приватни забави ќе ги направи да бидат ИДЕАЛНИ !','https://www.facebook.com/profile.php?id=100090368746384&locale=mk_MK','https://www.instagram.com/idealbandskopje/','n/a','https://youtu.be/Yno9HtUb30w?si=o-7IBGkFCryB-z7k','n/a','2024-05-17 20:19:20','2024-05-17 20:23:01',NULL,NULL),(14,'DJ Александар Јорданов','dj-aleksandar-jordanov','67482-DJ Aleksandar.jpg','75824-V1.png','078 601 879','<p>Swing, NuJazz &amp; 70&#39;S,80&#39;S, 90&#39;S Music!<br />\r\nDance Like No One&#39;s Watching!</p>\r\n\r\n<p></p>\r\n\r\n<p></p>\r\n\r\n<blockquote class=\"instagram-media\" data-instgrm-captioned