INSERT INTO `profile` VALUES (2,'The beauty Agency by Najdosky','the-beauty-agency-by-najdosky','42955-FaceApp_1654289155789.jpg','97573-logo-marija.jpg','075 303 011','marijanajdoska93@gmail.com','<p>Master Educator🥇Marija Najdoska🥇offers you:<br />\r\n♡MakeUp<br />\r\n♡Hair<br />\r\n♡LashLift<br />\r\n♡Brow Lamination<br />\r\n♡Nails<br />\r\n♡Madero</p>',45,'Master & Educator','https://www.facebook.com/thebeautyagencybynajdosky','https://www.instagram.com/m.najjj_do_sky/','n/a','n/a','n/a',41.9865342524,21.4544365411,'2024-04-09 19:10:28','2024-04-09 19:43:43'),(3,'Hairhouse','hairhouse','34142-IMG_7659.jpeg','74201-HairHouse Logo Final (1)-2.png','071 579 101','hair_house_@hotmail.com','<p>Hair house&nbsp;претставува еден од најреномираните фризерски салони. Одличен спој на професионалност, искуство и задоволни клиенти. Посебен акцент се става на желбите и идеите на идните невести за нивниот посебен ден. Секогаш спремни да ги изреализираат нивните барања. Резултатот е одново ист, насмеани, задоволни и секогаш добредојдени клиенти.</p>',50,'Beauty, cosmetic & personal care','https://www.facebook.com/p/HairHouse-100050418046048/','https://www.facebook.com/p/HairHouse-100050418046048/','n/a','n/a','n/a',41.9979274000,21.3982678000,'2024-04-16 18:48:35','2024-04-16 18:48:35'),(4,'Божиновски часовници','bozinovski-casovnici','33990-Каверот.jpg','92854-Bozinovski png-1000x1000.jpg','070363265','contact@bozinovski.com.mk','<p>Компанијата Божиновски часовници и накит, пионер во стилот и иновацијата во Македонија уште од 1996 година, започна со работа во Битола и набрзо ја прошири својата продажна мрежа и во Скопје. Покрај четирите сопствени продажни салони, Божиновски ги нуди своите производи и низ мрежата на агенти и франшизи низ Македонија.</p>\r\n\r\n<p>Компанијата веќе 29 години создава вредности, доверба и квалитет, кои секојдневно преку вложување и грижа кон своите вработени ги пренесува на сите свои купувачи.</p>\r\n\r\n<p>Брендот Божиновски, како официјален претставник, е препознатлив по врвните, исклучителни модели на: Omega, Breitling, Damiani, Longines, Hamilton, Montblanc, Tissot, TAG Heuer, Ti Sento, Swatch, Troika, и Flik Flak. Кај нас, за сите ваши посебни моменти, можете да најдете и уникатни колекции на златни прстени.</p>',64,'Официјален претставник на: Omega, Breitling, Damiani, Longines, Hamilton, Montblanc, Tissot, TAG Heuer, Ti Sento,Swatch, Troika, и Flik Flak.','https://www.instagram.com/bozinovski_official/','https://www.instagram.com/bozinovski_official/','n/a','n/a','https://bozinovski.com.mk/',42.0031209271,21.4733393670,'2024-05-13 18:39:02','2024-05-13 18:39:02'),(5,'Божиновски накит','bozinovski-nakit','85788-coverDAMIANI.png','62517-Bozinovski png-1000x1000.jpg','070363265','contact@bozinovski.com.mk','<p>Компанијата Божиновски часовници и накит, пионер во стилот и иновацијата во Македонија уште од 1996 година, започна со работа во Битола и набрзо ја прошири својата продажна мрежа и во Скопје. Покрај четирите сопствени продажни салони, Божиновски ги нуди своите производи и низ мрежата на агенти и франшизи низ Македонија.</p>\r\n\r\n<p>Компанијата веќе 29 години создава вредности, доверба и квалитет, кои секојдневно преку вложување и грижа кон своите вработени ги пренесува на сите свои купувачи.</p>\r\n\r\n<p>Брендот Божиновски, како официјален претставник, е препознатлив по врвните, исклучителни модели на: Omega, Breitling, Damiani, Longines, Hamilton, Montblanc, Tissot, TAG Heuer, Ti Sento, Swatch, Troika, и Flik Flak. Кај нас, за сите ваши посебни моменти, можете да најдете и уникатни колекции на златни прстени.</p>',64,'Damiani & Ti sento','https://www.facebook.com/Bozinovskiwatchesandjewelry','https://www.instagram.com/bozinovski_official/','n/a','n/a','https://bozinovski.com.mk/',41.9879199000,21.4345220000,'2024-05-13 18:53:03','2024-05-13 18:53:03');
