INSERT INTO `restaurants` VALUES (2,'Аликас','alikas','61698-25136-image00051.jpg','67310-Screenshot 2024-01-31 at 12.40.13.png','+389 78 33 24 33','<p>Аликас е ресторан кој се наоѓа на 5 километри од центарот на градот во пријатна и тивка околина. Се протега на голема зелена површина, каде ресторанскиот дел изнесува 600 м2&nbsp;и е со капацитет од 250 до 400 гости. На зеленилото е превидено да се прават свадби и прослави под отворено небо, а исто така е организирано одржување на матично на отворено. Ресторанот обезбедува паркинг-места&nbsp;за 100 возила, кој ќе биде под постојан видео-надзор, како и игротека за најмалите гости. Салата за свечености е предвидена за летни и зимски свадби, што значи дека во лето се отвора од сите три страни и има подно ладење, а во зима се затвора од сите три страни со стаклена фасада и има подно греење.</p>','2024-01-31 11:40:35','2024-04-04 19:39:17','Vizbegovo / Skopje, Macedonia',1,400,27,27,30,10,'Каде Бајката Започнува','http://www.facebook.com/allikasmk','http://instagram.com/allikas_skopje','http://www.twitter.com/allikascenter','н/а','https://alikas.mk/',42.0351322000,21.4050789000,0,6),(3,'Лав','lav','25542-zurka23.jpg','14952-lav.png','+389 78 33 24 33','<p>&nbsp;Во потрага сте по модерно место во градот каде што атмосферата ќе ги разгали вашите сетила, а гастрономската храна и пијалоци ќе ве импресионираат? Тогаш мора да го посетите ресторан &bdquo;Лав&ldquo; во склоп на ресторанот &bdquo;Аликас&ldquo;. Тука креираме неповторливи јадења што се поврзани со сезонски вкусови и свежи состојки. Од класични вкусови до модерни иновации, секое јадење е приготвено со љубов и внимание. Нашата широка понуда на вина и коктели дополнително ќе ја направат секоја посета незаборавна.</p>','2024-02-03 18:39:37','2024-03-14 16:20:31','ул.Качанички пат 148, Визбегово',1,200,27,27,27,10,'Love',NULL,NULL,NULL,NULL,NULL,42.0350184000,21.4052557000,0,7),(12,'Парк','park','65566-park.webp','37014-park-web2-bela-final.png','+389 72 226 123','<h2>ПАРК</h2>\r\n\r\n<p>Уште од самото отварање, ресторан Парк стана синоним за една поинаква и романтична свадбена приказна во Скопје. Лоциран во срцето на градот, ресторан Парк е опкружен со зеленилото на Градскиот Парк и зрачи во пријатна атмосфера. Целиот концепт е внимателно осмислен и претставува сплет на стилски ентериер и декорација. Наш основен предизвик е секоја свадба да биде успешно реализирана а младенците и гостите да се задоволни и импресионирани од нашата врвна услуга.</p>\r\n\r\n<h3>КАПАЦИТЕТ</h3>\r\n\r\n<ul>\r\n	<li><strong>За седење:</strong>&nbsp;350 гости</li>\r\n	<li></li>\r\n	<li><strong>Паркинг места:</strong>&nbsp;100 гости</li>\r\n</ul>\r\n\r\n<h3>КАРАКТЕРИСТИКИ</h3>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Приватна соба</p>\r\n	</li>\r\n	<li>\r\n	<p>Свадбена декорација</p>\r\n	</li>\r\n	<li>\r\n	<p>Бесплатни паркинг места</p>\r\n	</li>\r\n	<li>\r\n	<p>Професионално осветлување</p>\r\n	</li>\r\n	<li>\r\n	<p>Организирање матично во Градскиот Парк на Скопје</p>\r\n	</li>\r\n</ul>','2024-02-08 20:21:22','2024-02-08 20:24:54','УЛИЦА КЕЈ 13 НОЕМВРИ 4А',1,350,24,24,40,13,'Weddings | Event Center','https://www.facebook.com/Ragusa360','https://www.instagram.com/ragusa360/','n/a','n/a','https://www.park.mk/',42.0035944000,21.4279797000,0,3),(13,'Ragusa 360','ragusa-360','70991-IMG_8889.jpg','80103-logo.png','+389 75 398 919','<h2>RAGUSA ROOFTOP</h2>\r\n\r\n<p>Доколку вашата свадба ја замислувавте во модерен амбиент, на префинето место кое зрачи со својата софистицираност, тогаш вие сте на вистинското место.<br />\r\nАтрактивната локација, ентериерот и вкусната храна надополнети со беспрекорната услуга со сигурност ќе Ве импресионира вас и вашите гости.<br />\r\nПовелете и создадете си комплетно уживање во вашиот најсвечен ден од животот.</p>\r\n\r\n<h3>КАПАЦИТЕТ</h3>\r\n\r\n<ul>\r\n	<li><strong>За седење:</strong>&nbsp;400 гости&nbsp; &bull;&nbsp;<strong>Коктел:</strong>&nbsp;750 гости&nbsp;&bull;&nbsp;<strong>Театар:</strong>&nbsp;200 гости</li>\r\n</ul>\r\n\r\n<h3>КАРАКТЕРИСТИКИ</h3>\r\n\r\n<ul>\r\n	<li>\r\n	<p>4 лифтови</p>\r\n	</li>\r\n	<li>\r\n	<p>3,6m висина</p>\r\n	</li>\r\n	<li>\r\n	<p>Бина (20cm издигната од подот)</p>\r\n	</li>\r\n	<li>\r\n	<p>Приватна соба (гардеробер, релакс софа, сеф, тоалет)</p>\r\n	</li>\r\n	<li>\r\n	<p>1.200m<sup>2</sup>&nbsp;комплетен простор (700m<sup>2</sup>&nbsp;корисен простор)</p>\r\n	</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Супер брз интернет</p>\r\n	</li>\r\n	<li>\r\n	<p>Неограничен паркинг</p>\r\n	</li>\r\n	<li>\r\n	<p>Комплетна декорација</p>\r\n	</li>\r\n	<li>\r\n	<p>Професионално озвучување</p>\r\n	</li>\r\n	<li>\r\n	<p>Професионално осветлување (Intelligent Lighting)</p>\r\n	</li>\r\n</ul>\r\n\r\n<p></p>','2024-02-08 20:22:54','2024-02-15 10:10:00','Ул. Св. Кирил и Методиј бр.1/1',1,400,23,23,40,13,'Rooftop | Weddings & Events','https://www.facebook.com/Ragusa360','https://www.instagram.com/ragusa360/','n/a','n/a','n/a',41.9895782000,21.4321250000,0,4),(14,'Ragusa 919','ragusa-919','26297-64c11a2167e40782293220.webp','51798-logo919.png','+389 75 423 456','<h2>RAGUSA 919</h2>\r\n\r\n<p>Доколку ја замислувате Вашата свадба во современ, луксузен и романтичен амбиент, далеку од градскиот метеж, на само 4 км од центарот на градот, Рагуза 919 е вистинското место за Вас. Нашиот искусен тим се грижи за задоволството на секој гостин и креираме спомени што се паметат цел живот.</p>\r\n\r\n<h3>КАПАЦИТЕТ</h3>\r\n\r\n<ul>\r\n	<li><strong>За седење:</strong>&nbsp;360 гости</li>\r\n</ul>\r\n\r\n<h3>КАРАКТЕРИСТИКИ</h3>\r\n\r\n<ul>\r\n	<li>\r\n	<p>5m висина</p>\r\n	</li>\r\n	<li>\r\n	<p>Професионално озвучување</p>\r\n	</li>\r\n	<li>\r\n	<p>Сопствен паркинг за 150 автомобили</p>\r\n	</li>\r\n	<li>\r\n	<p>Лоциран на само 4 км од центарот на градот</p>\r\n	</li>\r\n	<li>\r\n	<p>Професионално осветлување (Intelligent Lighting)</p>\r\n	</li>\r\n	<li>\r\n	<p>1.200m2 комплетен простор (919m2 корисен простор)</p>\r\n	</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Приватна соба</p>\r\n	</li>\r\n	<li>\r\n	<p>Супер брз интернет</p>\r\n	</li>\r\n	<li>\r\n	<p>Комплетна декорација</p>\r\n	</li>\r\n	<li>\r\n	<p>Бина (20 цм издигната од подот)</p>\r\n	</li>\r\n	<li>\r\n	<p>Тоалети [м/ж] за лица со посебни потреби</p>\r\n	</li>\r\n	<li>\r\n	<p>Непречен пристап за лица со посебни потреби</p>\r\n	</li>\r\n	<li>\r\n	<p>Посебен простор за мајки со елемент за повивање на доенчиња и мали деца</p>\r\n	</li>\r\n</ul>','2024-02-08 20:29:01','2024-03-14 11:20:29','УЛ. ГАВРИЛ КОНСТАНТИНОВИЌ БР. 76',1,360,26,26,40,13,'Weddings | Event Center','https://www.facebook.com/Ragusa919/','https://www.instagram.com/ragusa_919/','n/a','n/a','https://ragusa919.com/',41.9783018000,21.4820883000,0,5),(15,'Villa Kasijana','villa-kasijana','48897-IMG_8891.JPG','2457-418150994_904246701393047_1177203710983921173_n.jpg','070414474','<p>Вила Касијана е најдобар избор за организирање на Вашите свечености од приватен или деловен тип:</p>\r\n\r\n<ul>\r\n	<li>свадби</li>\r\n	<li>крштевки</li>\r\n	<li>родендени</li>\r\n	<li>семинари</li>\r\n	<li>работилници</li>\r\n	<li>конференции</li>\r\n	<li>фестивали</li>\r\n</ul>\r\n\r\n<p>Располагаме со 5.000 &nbsp;м2, &nbsp;капацитет до 450 лица, 1.000 м2 гардина и 230 обележани паркинг места.</p>\r\n\r\n<p></p>','2024-02-15 21:19:12','2024-03-14 11:17:40','Boris Trajkovski (Prvomajska) 266',1,450,23,23,28,22,'Wedding and event centar','https://www.facebook.com/profile.php?id=100054231770470&sk=about','https://www.instagram.com/villakasijana/','n/a','n/a','http://villakasijana.mk',41.9594158000,21.4823461000,0,1),(16,'Александар Палас','aleksandar-palas','41745-51965290.jpg','41573-download.jpg','+389 2 3092 392','<p>Хотелот Александар Палас&nbsp;е најдобриот хотел во Скопје. Лоциран на десната страна на реката Вардар&nbsp;и на само три километри од Центарот на градот. Во близина на Хотелот се сите поважни&nbsp;културни&nbsp;локалитети и административни&nbsp;згради</p>','2024-03-11 21:22:03','2024-03-14 16:20:31','Бул. 8-ми Септември 15',1,300,30,30,100,29,'Најдобриот хотел во Скопје','https://www.facebook.com/hotelaleksandarpalace','https://www.instagram.com/hotelaleksandarpalace/',NULL,NULL,'https://www.aleksandarpalace.com.mk',42.0107872000,21.4055954000,0,8),(18,'Villa Ina','villa-ina','89507-6.webp','46001-villa-ina.png','+38975314285','<h3>Идеално место за вашите свадби и прослави</h3>\r\n\r\n<p>Доколку секогаш сте ја замислувале вашата венчавка или прослава на отворено, Вила Ина е она што го барате!</p>\r\n\r\n<p>Сместена на падините на Водно, во близина на селото г. Нерези, Вила Ина е идеално место за сите што сакаат својата приватна или деловна прослава да ја организираат на отворен простор и во природен амбиент. Таа е совршен спој на приватна интимна градина и модерно опремен простор кој ги нуди сите услови за современо организирање на настани, според замислата и желбата на клиентите. Далеку од градската врева и метеж, опкружена со прекрасни природни убавини, Вила Ина нуди прекрасен спој на природата и сите удобства коишто се потребни за да биде вашиот настан доживување што ќе се памети</p>','2024-03-12 10:17:40','2024-03-14 11:19:53','Улица Водно (Горно Нерези), 1000 Скопје, Македонија',1,400,32,32,80,30,'Weddings & Events','https://www.facebook.com/vilainaskopje','https://www.instagram.com/villa_ina_skopje/',NULL,NULL,NULL,41.9812095000,21.3793409000,0,2),(19,'Ресторан Ритуал','restoran-ritual','23487-image5.jpeg','32913-Samo ritual.png','077 568 022','<p>Веќе 18 години заедно креираме спомени.&nbsp;</p>\r\n\r\n<p>Постоиме за организирација на Вашите најубави моменти од животот и подготвени сме веднаш да организираме настан кој е беспрекорен!</p>\r\n\r\n<p>Се наоѓаме надвор од градскиот метеж на само 9км од центарот на градот.</p>\r\n\r\n<p>Организираме секаков тип на приватни и деловни прослави&nbsp;</p>\r\n\r\n<ul>\r\n	<li>свадби, матично, веридби, крштевки, мекици, родендени,матури, коктел забави, кетеринг настани како и&nbsp;</li>\r\n	<li>семинари, конференции, работилници, фестивали, свечености&hellip;</li>\r\n</ul>\r\n\r\n<p>Комплексот Ритуал располага со 4 свечени сали од кои&nbsp;</p>\r\n\r\n<p>Ресторан Ритуал е со капацитет од 250 гости и е одличен избор за современи, традиционални и класични свечености, погоден е за зимски и летни услови, целосно е климатизиран со амбиент од светски размери и одвоен дел за прием на гости.&nbsp;</p>\r\n\r\n<p>Храната од нашата кујна е секогаш превкусна и свежо подготвена со посебно внимание за која можеме да кажеме дека нема да ве остави рамнодушни.</p>\r\n\r\n<p>Повелете заедно да прославиме за Вашите нови почетоци во пријатна атмосфера со врвна професионална услуга и совршена организација!</p>\r\n\r\n<p>Место каде убавите нешта ќе станат ваши ритуали!</p>','2024-04-04 19:31:21','2024-04-04 19:31:21','С. Трубарево',1,350,1,22,59,43,'n/a','n/a','n/a','n/a','n/a','n/a',41.9815305000,21.5249121000,0,7),(22,'Везилка','vezilka','22355-8.jpg','58845-logo_vezilka_200.jpg','075225670','<p>&nbsp;По 10-годишно постоење во 2024 година ресторан Везилка добива комплетно нов и уникатен изглед. Новата луксузна и грандиозна Везилка е спој на модерното и урбаното. Новиот импресивен дизајн овозможува организирање на корпоративни настани, свадбени прослави, мекици, крштевки, матури... Со капацитет од 200 до 420 гости и паркинг простор за 150 возила, со 24 часовен надзор, ресторан Везилка овозможува беспрекорна услуга и врвен квалитет.&nbsp; Никогаш не ги забораваме и најмалите гости за кои што имаме обезбедено детско игралиште. Посебно внимание е посветено на дизајнирање на простор за одржување на матичното во нашата отворена градина. Професионалното осветлување и уникатната декорација кои што ги обезбедува ресторанот се дел од понудата, заедно со апартман за младоженци и шампањско за наздравување.</p>','2024-04-04 20:08:56','2024-06-19 19:03:09','Boris Trajkovski 174',1,420,34,34,35,44,'Weddings | Event Center','https://www.facebook.com/vezilka/','https://www.instagram.com/restoranvezilka/','n/a','n/a','https://www.facebook.com/vezilka/',41.9674088000,21.4697941000,0,7),(23,'Летна градина Ритуал','letna-gradina-ritual','76166-image2.webp','29694-274496053_4774305115972253_3619235981610278488_n.jpg','075 475 705','<p></p>\r\n\r\n<p>Летна градина ритуал<br />\r\n<br />\r\nПо долгогодишно искуство во областа на угостителството и доменот на креирање на Вашите најважни моменти заедно чест ни е да Ви понудиме неодолива комбинација на отворен и затворен дел односно можност за прослава под отворено небо и забава покрај базен, одлична организација, насмеани лица, посветена професионална услуга додека пак добрата храна нема да изостане. Она што го прави овој ресторан уникатен и единствен е огромниот убаво уреден двор од 20.000 м2 во кој има базен и преубава градина и тревници. Има капацитет од 320 гости а доколку временските услови го дозволуваат тоа дури и до 450 гости.</p>\r\n\r\n<p><br />\r\nИгротеката е во склоп со овој ресторан има капацитет од 70 гости и располага со огромен надворешен простор со безброј шарени играчки и катче за сите возрасти. Организираме секаков тип на приватни и деловни прослави односно свадби, матично, веридби, крштевки, мекици, родендени,матури, коктел забави, кетеринг настани, семинари, конференции, работилници, фестивали, свечености.<br />\r\nРасполагаме со шест апартмани, 300 бесплатни паркинг места, професионално бесплатно осветлување, озвучување и декорација.</p>','2024-04-04 20:49:20','2024-04-04 20:49:20','Мирче Ацев 22 Трубарево',1,320,1,25,59,43,'Weddings & Events','https://www.facebook.com/RestoranRitual/','https://www.instagram.com/letnagradinaritual/','n/a','n/a','n/a',41.9815305000,21.5249121000,0,7),(24,'Ритуал Премиум','ritual-premium','46908-image9.webp','55640-ritual-logoo.jpeg','075-475-705','<p>Ритуал&nbsp;Премиум</p>\r\n\r\n<p>Изграден со големо внимание и една цел што поголем број на задоволни гости!</p>\r\n\r\n<p>Почуствувајте ја магијата на свадбените ритуали опкружени со луксуз, префинетост и елеганција.</p>\r\n\r\n<p>Ви нудиме модерен ентериер, уникатен простор, пријатен амбиент, професионална услуга и врвна храна.</p>\r\n\r\n<p>Организираме секаков тип на приватни и деловни прослави&nbsp;</p>\r\n\r\n<ul>\r\n	<li>свадби, матично, веридби, крштевки, мекици, родендени,матури, коктел забави, кетеринг настани како и&nbsp;</li>\r\n	<li>семинари, конференции, работилници, фестивали, свечености&hellip;</li>\r\n</ul>\r\n\r\n<p>Ресторанот има капацитет од 430 гости седење и 1000 гости коктел.</p>\r\n\r\n<p>Има целосно подно греење и ладење.</p>\r\n\r\n<p>Можеме да ви понудиме шест различни апартмани, посебен простор за мајки со елемент за повивање, 300 бесплатни паркинг места, интернет, професионално&nbsp;&nbsp;бесплатно осветлување, озвучување и декорација.</p>','2024-04-04 21:20:14','2024-04-22 17:30:17','Мирче Ацев 22 Трубарево',1,320,1,25,59,43,'Weddings & Events','n/a','n/a','n/a','n/a','n/a',41.9815305000,21.5249121000,0,7),(25,'Дениција','denicija','50518-DEN_2883.jpg','37052-Denicija-Logo-Vector.png','078225750','<p><strong>Дениција</strong>&nbsp;е&nbsp;ресторан за свадби, настани и прослави во Скопје. Инспирацијата за овој ресторан доаѓа од македонската &ldquo;Химна на љубовта&rdquo; - безвремената Дениција. Таа ја симболизира ѕвездата Деница, најсјајната на небото, симбол на светлината, плодноста и убавината.</p>\r\n\r\n<p>Дениција е помалата сестра на&nbsp;<a href=\"https://dragigosti.com/restaurants/vezilka\" target=\"_blank\">Везилка</a>, дизајнирана и водена од истиот тим кој успешно ја позиционираше Везилка меѓу најдобрите ресторани за свадби во Македонија. Тоа беше еден од главните предизвици при планирањето на Дениција, да се задржи препознатливиот квалитет, но и да се понуди нешто ново. Формата и функцијата на просторот ја прават Дениција уникатна.. Простор кој во лето е комплетно отворен и климатизиран, зиме затворен со најсовремена технологија на греење, а оваа трансформација е можна за само неколку минути.&nbsp;</p>\r\n\r\n<p></p>\r\n\r\n<p>Ресторан Дениција нуди:</p>\r\n\r\n<p></p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Капацитет од 150 до 350 гости</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Паркинг за 100 возила</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Комплетна декорација&nbsp;</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Осветлување во боја</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Апартман за младите</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Кетеринг сервис</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Врвна услуга</p>\r\n\r\n<p></p>','2024-04-22 11:35:35','2024-04-22 12:07:43','Бул. Борис Трајковски 174а, Кисела Вода, Скопје',1,350,44,20,50,44,'Weddings | Event Center','https://www.facebook.com/denicija.mk/','https://www.instagram.com/denicija.mk','н/а','н/а','http://denicija.mk/',41.9673181000,21.4696349000,0,7),(26,'Ederra | Rooftop','ederra-rooftop','41916-rsz_slikata_na_postuvanjeto.jpg','7907-280347422_111942368180089_6821387277270175659_n.jpg','+389 78 835 636','<h1 dir=\"auto\"><span style=\"font-size:16px\">Нова љубовна приказна во градот!<br />\r\nПрекрасен поглед на градот, луксузен амбиент, беспрекорна услуга...совршен избор за сите ваши прослави! 🥂</span></h1>','2024-04-22 15:34:18','2024-04-22 16:06:26','Булевар 8-ми Септември 40, 1000 Скопје',1,300,1,25,50,57,'Wedding & Events','https://www.facebook.com/ederrarooftop','https://www.instagram.com/ederra_rooftop/?hl=en','n/a','n/a','n/a',42.0139784000,21.4083808000,0,7),(27,'DoubleTree by Hilton Skopje','doubletree-by-hilton-skopje','43567-420552768_752430176910965_3258947918623718749_n.jpg','57224-Logo.jpg','075 333 968','<p>Прославете го денот на вашите соништа во DoubleTree by Hilton во Скопје.</p>\r\n\r\n<p>Изразете ја вашата индивидуалност, тоа е ваш ден и само вие знаете што ќе биде потребно за да</p>\r\n\r\n<p>го направите совршен.</p>\r\n\r\n<p>Нашиот талентиран тим за свадби ќе ја трансформира Diamond Ballroom салата во совршено<br />\r\nпрекрасен амбиент. Со задоволство ќе ви помогнат да ја искажете вашата љубов. Ваша идеја,</p>\r\n\r\n<p>наша реализација.</p>\r\n\r\n<p>Организирајте ги Вашите семејни прослави и уверете се во беспрекорната услуга која ја нуди<br />\r\nнашиот тим. Дозволете DoubleTree by Hilton Skopje да го направи секој собир посебен на свој</p>\r\n\r\n<p>единствен начин.</p>\r\n\r\n<p>Свадбениот пакет вклучува:</p>\r\n\r\n<p>&bull; Маси, столици, покривки на столиците, чаршафи за масите, специјален прибор за<br />\r\nјадење, маса за подароци, маса за торта<br />\r\n&bull; Посветен координатор за вашата свадба<br />\r\n&bull; Сечење на торта и сервирање<br />\r\n&bull; 1 шише Просеко за наздравување<br />\r\n&bull; Сместување за невестата и младоженецот за нивната брачна ноќ со вклучен појадок<br />\r\n&bull; Посебен попуст за вашите гости на свадбата<br />\r\n&bull; Бесплатна проба на менито за свадба (по потпишување на договорот)<br />\r\n&bull; 20 бесплатни места за паркирање</p>','2024-05-23 19:41:52','2024-05-23 19:41:52','Булевар АСНОМ 17, Скопје',1,300,1,65,85,68,'Celebrate your special day in the unforgettable venue','https://www.facebook.com/hiltonskopje/','n/a','https://x.com/doubletree','n/a','https://www.hilton.com/en/brands/doubletree-by-hilton/',41.9903280000,21.4732432000,0,7),(28,'Roof bar 55 Double Tree by Hilton','roof-bar-55-double-tree-by-hilton','11940-420552768_752430176910965_3258947918623718749_n.jpg','76927-Logo Bar55.jpg','075/333-968','<p>Прославете го денот на вашите соништа во DoubleTree by Hilton во Скопје.&nbsp;</p>\r\n\r\n<p>Изразете ја вашата индивидуалност, тоа е ваш ден и само вие знаете што ќе биде потребно за до го направите совршен.</p>\r\n\r\n<p>Нашиот талентиран тим за свадби ќе ја трансформира Diamond Ballroom салата во совршено<br />\r\nпрекрасен амбиент. Со задоволство ќе ви помогнат да ја искажете вашата љубов. Ваша идејанаша реализација.</p>\r\n\r\n<p>Организирајте ги Вашите семејни прослави и уверете се во беспрекорната услуга која ја нуди<br />\r\nнашиот тим. Дозволете DoubleTree by Hilton Skopje да го направи секој собир посебен на свој единствен начин.</p>','2024-05-23 20:42:55','2024-05-23 20:42:55','Булевар АСНОМ 17, Скопје',1,60,1,65,85,68,'Celebrate your special day in the unforgettable venue Roof Bar No. 55','n/a','https://www.instagram.com/roofbarno.55/','https://x.com/doubletree','n/a','https://www.hilton.com/en/brands/doubletree-by-hilton/',41.9903280000,21.4732432000,0,7);
